import './App.css';

function App() {
    return (
      <div className="kiosk-screen">
        <div className="kiosk-menu">
          <ul>
            <li>커피</li>
            <li>티</li>
            <li>디저트</li>
          </ul>
        </div>
      </div>
    );



}
export default App;
